(function(){angular.module("myApp").filter("calculatedDate",function(){return function(f){var b=new Date(f);var e=new Date();var d=(Math.floor((e-b)/(1000*60))%60).toLocaleString(undefined,{minimumIntegerDigits:1});var c=Math.floor((e-b)/(1000*60*60)).toLocaleString(undefined,{minimumIntegerDigits:1});if(c<1){if(d<2){return"לפני דקה"}return"לפני "+d+" דקות"}if(c<24){if(c<2){return"לפני שעה"}if(c<3){return"לפני שעתיים"}return"לפני "+c+" שעות"}var a=["","ינואר","פבואר","מרץ","אפריל","מאי","יוני","יולי","אוגוסט","ספטמבר","אוקטובר","נובמבר","דצמבר"];return dateToReturn=(f.slice(8,10)+" "+a[parseInt(f.slice(5,7),10)]+", "+f.slice(0,4))}})})();